import React from 'react'

const SearchPage = ({selectedTab}) => {

	return (

		<div> 
             <h3>Search</h3>
            <div className="row">
              {selectedTab?.map((movie) => {
                return (
                  <div className="column" key={movie?.id}  >
                    <img src={`https://image.tmdb.org/t/p/w500${movie?.poster_path}`} alt=""   />
                    <h5>{selectedTab?.title}</h5>
                    <p>{selectedTab?.overview}</p>
                    <p>Rating: {selectedTab?.vote_average} ({selectedTab?.vote_count} votes)</p>
                   </div>
                )
              })}
              </div> 


		</div>
	)
}

export default SearchPage
